model_class: TorchModel
input_variables:
  gradient_length:
    variable_class: ScalarVariable
    default_value: 0.142857
    is_constant: false
    value_range: [0.0, 1.0]
    value_range_tolerance: 1.0e-08
  target_position:
    variable_class: ScalarVariable
    default_value: 0.0
    is_constant: false
    value_range: [-1.0, 1.0]
    value_range_tolerance: 1.0e-08
output_variables:
  energy_in_harmonics: {variable_class: ScalarVariable, is_constant: false, value_range_tolerance: 1.0e-08}
input_validation_config: null
output_validation_config: null
model: qed_ip2_model.jit
input_transformers: [qed_ip2_input_transformers_0.pt]
output_transformers: [qed_ip2_output_transformers_0.pt, qed_ip2_output_transformers_1.pt]
output_format: tensor
device: cpu
fixed_model: true
precision: double
